import React from "react";
import Props from "./props";
import Api from "./api";

let Comp1=()=>{
    return(
        <>
       <Props
          key={Api[2].id}
          img={Api[2].img}
          title={Api[2].title}
        />
        </>
    )
}
export default Comp1
